<!DOCTYPE html>
<html>
<head>
    <title></title>
    <script src="index.html-executionTrace.txt" type="application/javascript"></script>
</head>
<body>
<script>
    var lastLine = 0;
    for(var i = 0, length = model.length; i < length; i++)
    {
        var item = model[i];
        var currentFile = item.file;
        currentFile = currentFile.substring(currentFile.lastIndexOf("/") + 1);
        var currentLine = item.line;

        if(currentLine != lastLine)
        {
            var textNode = document.createTextNode(currentLine + ";");
            document.body.appendChild(textNode);
            document.body.appendChild(document.createElement("br"));
        }

        lastLine = currentLine;
    }
</script>

</body>
</html>
